import React, { Component, Suspense } from 'react';
//import * as router from 'react-router-dom';
import classNames from 'classnames';
import { CFooter, CHeader } from '@coreui/react';
import DefaultContent from './DefaultContent.js';


export const Context = React.createContext({show: false});

const DefaultSidebar = React.lazy(() => import('./DefaultSidebar'));
const DefaultAside = React.lazy(() => import('./DefaultAside'));
const DefaultFooter = React.lazy(() => import('./DefaultFooter'));
const DefaultHeader = React.lazy(() => import('./DefaultHeader'));

import Navigation from '../../Layout/Navigation';
import { useStyles } from '../../Layout/Theme/DashboardTheme';
import Copyright from '../../Layout/Copyright';
import Devices from '../Devicemanagement/Devices';
import DeviceDashboard from '../Devicemanagement/DeviceDashboard';
import { deviceMenuItems } from '../Devicemanagement/DeviceMenuItems';
import Logo from '../../../assets/images/logo.png';

export default function Modules() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
     
    </div>
  );
}
